    const CheckAlgoSigner = () => {
        const action = useCallback(() => {
          if (typeof AlgoSigner !== 'undefined') {
            return "AlgoSigner is installed.";
          } else {
            return "AlgoSigner is NOT installed.";
          }
        }, []);

      };


    return (
        <Button onClick={CheckAlgoSigner}> Connect AlgoSigner </Button>
    );
}

